import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import { Grid } from '@material-ui/core';


interface ITodo {
    text: string
    complete: boolean
  }

export default function TodoList(props: any): JSX.Element{

    const complete = (index: number): void => {
        props.todos[index].complete = !props.todos[index].complete
        props.setTodos([...props.todos])
      }

    return (
        <Grid container spacing={1} style={{ marginTop: '15px' }}>
                        <Grid item xs={12} >
                <Card variant="outlined" style={{    width: '95%'}}>
                    <CardContent>
                        {props.todos.map((todo: ITodo, index: number) => (
                            <Typography color="textSecondary" gutterBottom>
                                {todo.text}
                            </Typography>
                        ))}
                    </CardContent>
                </Card>
            </Grid>


      </Grid>
    )

}
